import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import Hero2 from "../components/Hero2";

const Meeting = () => {
  return (
    <div>
      <Navbar />
      <Hero2 />
      <Footer />
    </div>
  );
};

export default Meeting;
